import ExpenseItem from "./Componants/ExpenseItem";

function App() {
  const expenses = [
    {
      "title": "Groceries",
      "amount": 50.25,
      "date": "2023-07-24T12:34:56Z"
    },
    {
      "title": "Gasoline",
      "amount": 30.50,
      "date": "2023-07-23T08:15:30Z"
    },
    {
      "title": "Dinner",
      "amount": 75.00,
      "date": "2023-07-22T19:45:00Z"
    },
    {
      "title": "Movie Tickets",
      "amount": 40.75,
      "date": "2023-07-21T20:30:00Z"
    }
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
